INSERT INTO `WEBSITE_CASE` VALUES ('1', '微金客', '公司官网', 'https://www.vjinke.com/', 'vjinke_logo.jpg', 'vjinke.png', '北京微金客科技有限公司（简称“微金客”），成立于2014年8月，注册资金1亿元，企业始终秉承“专业 服务 创新 乐享”的核心品牌价值观，共创“小金融，大梦想！”的互联网金融综合服务平台。\r\n\r\n \r\n\r\n　　微金客致力于打造一个诚信的综合性服务云平台，我们拥有完善的金融生态体系——产品丰富、合法合规、交易便捷、资金存管，满足不同出借者不同人生阶段的出借需求。\r\n\r\n \r\n\r\n　　企业核心团队成员均来自国内外知名金融机构及IT资深精英，具备丰富的行业经验，严格遵守国家相关法律法规、并以严格的风控措施、优质的产品体系、先进的安全技术保障、全面专业的服务帮助互联网出借者实现金融出借增值。', '0', '1', '1', '2019-02-28 16:50:45', null, 'vjinke');
INSERT INTO `WEBSITE_CASE` VALUES ('2', '君德财富', '公司官网', 'http://www.ksfortune.com/', 'jdcf_logo.jpg', 'jdcf.png', '财富管理行业兴起于16世纪的欧洲，并成熟于18世纪的美国，主要面向高净值客户提供全面的财富管理服务。1997年中信银行广东分行成立首家私人银行部，标 志着中国财富管理行业的起步。目前，国内可提供财富管理服务的主体包括平台型机构（商业银行的私人银行）、产品型机构（券商、信托公司、基金公司、保险公司 等）以及第三方财富管理机构。相比其他财富管理机构，第三方财富管理机构以“独立”、“客观”、“公信”等特征，形成自身核心优势，逐步赢得广大投资者的普 遍认可和青睐。', '0', '0', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('3', '国恒保险', '公司官网', 'http://www.ksghi.com/', 'insurancePC_logo.jpg', 'insurancePC.png', '北京君德财富投资管理有限公司旗下的北京国恒保险代理有限公司（以下简称“国恒保险”www.ksghi.com）于2003年注册成立，2014年经中国保险监督管理委员会批准的全国性专业保险代理公司，2015年成为北京市保险中介行业协会理事会员，并于2016年成功获批网销资格，注册资本金为5000万元人民币。', '0', '0', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('4', '君德聚富', '公司官网', 'https://www.jdjufu.com/', 'jdjf_logo.jpg', 'jdjf.jpg', '北京君德聚富投资顾问有限公司，自成立以来致力于为国内高净值人群提供专业化、 个性化、全方位的海外资产配置服务。作为北京君德财富投资管理股份有限公司的控 股子公司君德聚富，让客户充分感受到一站式配置服务的便利，并且秉承一心一意为 客户服务的理念，累计服务客户6000多人，客户资产管理规模达到60多亿。致力于 做海外资产配置的领航者，持续为客户创造价值！', '0', '0', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('5', '君德时代', '集团官网', 'http://www.kingstartimes.com/', 'kingstartimes_logo.jpg', 'kingstartimes.jpg', '君德时代投资控股有限公司是一家迅速成长的集资产管理，财富管理，国际投资和网络金融公司于一体的综合性金融服务集团。总部位于中国首都北京，在香港设有海外投资机构，拥有丰富的地区资源和国际运作能力。', '0', '0', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('6', '华物投资', '公司官网', 'http://www.kstarfund.com/', 'kstarfund_logo.jpg', 'kstarfund.png', '华物投资管理有限公司于2010年成立于天津滨海新区，持有中国证券投资基金业协会颁发的《私募投资基金管理人登记证书》（编号：P1001508）。', '0', '0', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('7', '君德汇富', '汇富基金', 'https://www.kstreasure.com/', 'jdhf_logo.jpg', 'jdhf.jpg', '北京君德汇富基金销售有限公司（简称：君德汇富）成立于2013年，注册资本2000万，是君德财富股份有限公司旗下的全资子公司，君德时代投资控股有限公司（君德时代集团）是一家迅速成长的集资产管理，财富管理，国际投资和网络金融公司于一体的综合性金融服务集团。总部位于中国首都北京，在香港设有海外投资机构，拥有丰富的地区资源和国际运作能力。', '0', '0', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('8', '财富精灵', '管理系统', '无', 'cfjl_logo.jpg', 'cfjl.jpg', '财富精灵是由君德时代集团发起成立的独立化理财师创业平台，定位于满足金融机构及理财师对全而精产品配置的需求，构建丰富的金融机构产品信息和数据仓库，由资深团队进行合作机构筛选和产品评级，提供靠谱的优质产品和项目，为理财师提供产品全而精、佣金丰厚结算快、运营专业高效、管家式贴心服务，并为理财师提供crm系统、oa系统。', '0', '0', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('9', '财富360', '管理系统', '无', 'cf360_logo.jpg', 'cf360.png', '财富360是由君德时代集团发起成立的独立化理财师创业平台，定位于满足金融机构及理财师对全而精产品配置的需求，构建丰富的金融机构产品信息和数据仓库，由资深团队进行合作机构筛选和产品评级，提供靠谱的优质产品和项目，为理财师提供产品全而精、佣金丰厚结算快、运营专业高效、管家式贴心服务。\r\n\r\n \r\n\r\n　　个人和家庭理财方式逐步由传统的银行等专业金融机构向互联网和移动互联网转移。理财方式正在从购买产品，转向接受专业的资产配置服务，通过个性化的专业咨询服务，进行合理规划、持续理财使个人和家庭财富及抗风险能力最优化。理财市场方面，可配置的金融产品种类繁多，非专业人士很难从中择优选择，更缺乏统筹和配置的专业知识，需要专业理财顾问提供一对一的服务，线下理财顾问主要服务净资产在50万以上的客户，且用人工实现的服务其服务容量有限。通过系统算法和大数据分析可以提供更广大的基础服务能力，实现人人都能享受到专业化理财服务，通过一站式、自助式的资产配置工具和便捷的金融产品购买和统一客户服务，以及终身免费的财富管家服务可吸引各类金融机构（产品供给方）、理财师和第三方财富管理机构、终端用户等构建多边市场，形成终身财富管理平台。', '0', '1', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('10', '如来保', 'APP', '无', 'insuranceAPP_logo.jpg', 'insuranceAPP.jpg', '如来保是一款面向广大营销员伙伴们的应用软件，可以提供在线承保；在线计划书生成、分享；在线预约；投保状态实时跟踪；在线保单检视；风险缺口分析等全方位营销工具。助力营销员高效获客，高效成交。', '0', '1', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('11', '海德汇', 'APP', '无', 'overseas_logo.jpg', 'overseas.png', '随着国内中产阶级和高净值人群的不断增多，人均收入的不断提高，高端人群的视野不断开阔，任何一个行业和一家公司都很难满足所服务人群的全方位需求。销售终端的销售人员无论是理财师、置业顾问、保险规划师、高尔夫会籍顾问等等，在面对客户海外投资需求方面往往一无所知，或知之甚少，在国内销售竞争一片红海的局面中往往一筹莫展。\r\n\r\n \r\n\r\n　　海德汇”为了改善销售终端所面临的职业痛点，让销售人员更自由、更高效、更便捷的了解海外投资市场，服务自有高净值客户，唤醒在业务本中沉睡的客户，让更新的产品和服务理念满足客户不同的全方位需求。“海德汇销售服务平台”，采用互联网+销售终端的模式，通过与全球多达200家金融机构和资产管理机构以及房地产开发商的合作，打造国内最大的一站式海外资产配置平台，运用手机APP终端互联网技术，打通和终端销售的最后一公里，让销售人员能够快捷的筛选出适合于自己客户需求的相匹配的产品，真正做到为客户进行全球资产配置。\r\n\r\n \r\n\r\n　　核心优势：\r\n\r\n　　项目亮点多、风险把控严、产品品类全。独家提供包销产品，国内首推，一网打尽。\r\n\r\n　　业务模式：\r\n\r\n　　采用互联网+销售终端的模式\r\n\r\n　　第一、结佣快，客户成交后48小时内按照应结算佣金的20%先行支付到销售人员账户，后端在一个月内支付全部佣金。\r\n\r\n　　第二、佣金高，直接将产品和终端销售对接，取消中间环节，普遍高于市场佣金，让销售人员收入瞬间翻倍。\r\n\r\n　　第三、拼专业，专业视频培训，落地培训，Q&A直达用户，销售流程一目了然，一对一客服服务配备客服经理，打造行业服务标杆。', '0', '1', '1', '2019-02-28 16:50:45', null, '');
INSERT INTO `WEBSITE_CASE` VALUES ('12', '君德汇', 'APP', '无', 'serviceList04.png', 'serviceList04.png', '财富管理行业兴起于16世纪的欧洲，并成熟于18世纪的美国，主要面向高净值客户提供全面的财富管理服务。1997年中信银行广东分行成立首家私人银行部，标志着中国财富管理行业的起步。目前，国内可提供财富管理服务的主体包括平台型机构（商业银行的私人银行）、产品型机构（券商、信托公司、基金公司、保险公司等）以及第三方财富管理机构。相比其他财富管理机构，第三方财富管理机构以“独立”、“客观”、“公信”等特征，形成自身核心优势，逐步赢得广大投资者的普遍认可和青睐。\r\n\r\n \r\n\r\n　　北京君德财富投资管理股份有限公司成立于2011年1月11日，是国内领先的第三方财富管理机构之一，致力于为国高净值人群提供专业化、个性化、全方位的资产配置服务，包括为企业、家庭以及个人提供风险评估、资产投资规划、制定资产配置策略、以及资产配置执行等服务内容。\r\n\r\n \r\n\r\n　　经过五年的发展，君德财富已经成功为近万名高净值客户量身制定资产配置方案，客户资产管理规模近百亿，成为初具规模的金融公司，先后获得“年度投资收益最佳资产管理公司”、“年度卓越资产配置创新金融企业\'等多个奖项，获得了广大投资者与合作伙伴的尊敬与认可。\r\n\r\n \r\n\r\n　　截止2016年9月，已获得各项相关资质牌照，完成以下产品板块布局：\r\n\r\n　　公募基金：13家战略合作机构，532支公募产品；\r\n\r\n　　私募基金：30家战略合作机构，100支私募产品；\r\n\r\n　　保险产品：11家合作保险公司，107支保险产品。', '0', '1', '1', '2019-02-28 16:50:45', null, '');
