  `CREATOR_ID` int(11) DEFAULT NULL COMMENT '创建人id',
  `CREATOR_NAME` varchar(50) DEFAULT NULL COMMENT '创建人姓名',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

