  `TRS_PASSWPRD_FLAG` varchar(2) DEFAULT NULL COMMENT '交易密码标识',
  `ACCT_NO` varchar(20) DEFAULT NULL COMMENT '电子帐号',
  `TRANS_TIME` varchar(50) DEFAULT NULL COMMENT '交易时间',
  `TRANS_DATE` varchar(25) DEFAULT NULL COMMENT '交易日期',
  `TOTAL_SHARE` decimal(15,2) DEFAULT '0.00' COMMENT '总份额',
  `LOADING_SHARE` decimal(15,2) DEFAULT '0.00' COMMENT '在途份额',
