-- ----------------------------
-- Table structure for `USER_RECHARGE`
-- ----------------------------
DROP TABLE IF EXISTS `USER_RECHARGE`;
CREATE TABLE `USER_RECHARGE` (
  `ID` varchar(50) NOT NULL COMMENT 'ID',
  `USER_ID` varchar(50) NOT NULL COMMENT '平台用户ID',
  `UUID` varchar(50) DEFAULT NULL COMMENT '用户标识 个人账户 登录标识',
  `EACCOUNT_NO` varchar(19) NOT NULL COMMENT '电子账户 收款账号',
  `AC_NO` varchar(19) NOT NULL COMMENT '绑定银行卡卡号 付款账号',
  `TRS_PASSWORD` varchar(50) DEFAULT NULL COMMENT '电子账户交易密码',
  `TRS_AMOUNT` decimal(16,2) DEFAULT '0.00' COMMENT '转入金额 单位 元',
  `VERIFY_TRS_PASSWORD_FLAG` varchar(20) DEFAULT NULL COMMENT '交易密码验证标志',
  `TRS_BALANCE` decimal(16,2) DEFAULT '0.00' COMMENT '交易余额 单位 元',
  `CHANNEL_JNL_NO` varchar(32) DEFAULT NULL COMMENT '渠道流水号 最大32位',
  `JS_JNL_NO` varchar(32) DEFAULT NULL COMMENT '晋商流水号 最大32位',
  `TRANS_RESULT` varchar(20) DEFAULT NULL COMMENT '充值交易状态 U:未知 S:交易成功',
  `TRADE_STATUS` varchar(20) DEFAULT NULL COMMENT '交易状态 0—成功；\r\n1—失败；\r\n2-未找到该流水\r\n4-状态未明\r\n其他-未定义，当失败处理',
  `TXN_TIME` varchar(25) DEFAULT NULL COMMENT '交易时间 yyyy-mm-dd hh24:mi:ss',
  `TRS_END_TIME` varchar(25) DEFAULT NULL COMMENT '交易完成时间  yyyyMMddHHmiss',
  `RETURN_CODE` varchar(32) DEFAULT NULL COMMENT '处理结果 SUCCESS/FAIL',
  `RETURN_MSG` varchar(64) DEFAULT NULL COMMENT '结果信息描述 处理成功 错误原因提示等',
  `CREATE_TIME` varchar(24) DEFAULT NULL COMMENT '创建时间 yyyy-mm-dd hh24:mi:ss',
  `DATE_STATUS` char(1) NOT NULL DEFAULT '0' COMMENT '数据有效性 0-无效 1-有效',
  `REMARK` text COMMENT '备注信息',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户充值记录表';

-- ----------------------------
-- Records of USER_RECHARGE
