-- ----------------------------
-- Table structure for `USER_RISK`
-- ----------------------------
DROP TABLE IF EXISTS `USER_RISK`;
CREATE TABLE `USER_RISK` (
  `ID` varchar(50) NOT NULL COMMENT '风险ID',
  `USER_ID` varchar(50) DEFAULT NULL COMMENT '平台用户ID',
  `UUID` varchar(50) NOT NULL COMMENT '用户标识 个人账号 登录标识',
  `RISK_FLAG` varchar(20) NOT NULL COMMENT '是否需要重新评测 0:需要重新评测 1:不需要重新评测',
  `SCORE` varchar(20) DEFAULT NULL COMMENT '测评分数 RISK_FLAG=1时不需要返回',
  `RISK_LEV` varchar(20) DEFAULT NULL COMMENT '测评级别 1-保守型 2-谨慎型 3-稳健性 4-积极型 5-激进型',
  `EFFECTIVE_DATE` varchar(10) NOT NULL COMMENT '测评结果有效期 yyyyMMdd',
  `DETAIL` varchar(32) DEFAULT NULL COMMENT '测评结果答案明细 1_5,2_5,3_5 题号_答案编号以英文,分割',
  `RISK_LEV_EXPLA` varchar(255) DEFAULT NULL COMMENT '测评级别描述',
  `RETURN_CODE` varchar(32) DEFAULT NULL COMMENT '处理结果 SUCCESS/FAIL',
  `RETURN_MSG` varchar(64) DEFAULT NULL COMMENT '结果信息描述 处理成功 错误原因提示等',
  `DATA_STATUS` char(1) NOT NULL COMMENT '数据有效型 0-无效 1-有效',
  `CREATE_TIME` varchar(24) DEFAULT NULL COMMENT '创建时间 yyyy-mm-dd hh24:mi:ss',
  `REMARK` text COMMENT '备注信息',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户风险表';

-- ----------------------------
-- Records of USER_RISK
-- ----------------------------

