  `DATA_STATUS` char(1) DEFAULT NULL COMMENT '0:有效；1：无效 (数据有效性)',
  `CREATE_TIME` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8;

