-- ----------------------------
-- Table structure for `USER_TRANSACTION`
-- ----------------------------
DROP TABLE IF EXISTS `USER_TRANSACTION`;
CREATE TABLE `USER_TRANSACTION` (
  `ID` varchar(50) NOT NULL COMMENT 'ID',
  `USER_ID` varchar(50) NOT NULL COMMENT '用户标识 个人账号 登录标识',
  `UUID` varchar(50) DEFAULT NULL COMMENT '平台用户ID',
  `PAY_NO` varchar(19) DEFAULT NULL COMMENT '付款账户',
  `WITHDRADAL_NO` varchar(19) DEFAULT NULL COMMENT '收款账户',
  `TRS_AMOUNT` decimal(16,2) DEFAULT '0.00' COMMENT '交易金额 单位 元 收入为+值 支出为-值',
  `TRS_BALANCE` decimal(16,2) DEFAULT '0.00' COMMENT '交易余额 单位 元',
  `TRADE_STATUS` varchar(20) NOT NULL COMMENT '交易状态 0-成功 1失败 2-未找到该流水 4-状态未明 其他未定义 当失败处理',
  `RTXN_TYPE_CODE` varchar(20) NOT NULL COMMENT '交易类型代码 WTHI=资金转出 RCGI资金转入',
  `TXN_TIME` varchar(25) DEFAULT NULL COMMENT '交易时间 yyyy-MM-dd HH:mm:ss',
  `TRS_END_TIME` varchar(25) DEFAULT NULL COMMENT '交易完成时间 yyyyMMddHHmiss',
  `REXN_TYPE_NAME` varchar(50) DEFAULT NULL COMMENT '交易类型名称',
  `FLOW_TYPE` varchar(50) DEFAULT NULL COMMENT '资金流向 incoming:收入 expend:支出',
  `ORDER_ID` varchar(50) DEFAULT NULL COMMENT '交易单号 充值或提现ID',
  `TRANS_ID` varchar(50) DEFAULT NULL COMMENT '渠道流水号',
  `RETURN_CODE` varchar(32) DEFAULT NULL COMMENT '处理结果 SUCCESS/FAIL',
  `RETURN_MSG` varchar(64) DEFAULT NULL COMMENT '结果信息描述 处理成功 错误原因提示等',
  `DATA_STATUS` char(1) NOT NULL DEFAULT '0' COMMENT '数据有效性 0-无效 1-有效',
  `CREATE_TIME` varchar(24) DEFAULT NULL COMMENT '创建时间 yyyy-mm-dd hh24:mi:ss',
  `REMARK` text COMMENT '备注信息',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户交易记录表';

