  `TRS_PASSWORD` varchar(50) DEFAULT NULL COMMENT '电子账户交易密码',
  `TRS_AMOUNT` decimal(16,2) DEFAULT '0.00' COMMENT '转账金额 单位 元',
  `VERIFY_TRS_PASSWORD_FLAG` varchar(20) DEFAULT NULL COMMENT '交易密码验证标志 TRADING_TYPE为RCGI时必填 0:不验密 1:验密',
  `TRS_BALANCE` decimal(16,2) DEFAULT '0.00' COMMENT '交易余额 单位 元',
  `CHANNEL_JNL_NO` varchar(32) DEFAULT NULL COMMENT '渠道流水号 最大32位',
  `JS_JNL_NO` varchar(32) DEFAULT NULL COMMENT '晋商流水号 最大32位',
  `TRADE_STATUS` varchar(20) NOT NULL COMMENT '交易状态 U:未知 S:交易成功',
  `TXN_TIME` varchar(25) DEFAULT NULL COMMENT '交易时间 yyyy-mm-dd hh24:mi:ss',
  `TRS_END_TIME` varchar(25) DEFAULT NULL COMMENT '交易完成时间  yyyyMMddHHmiss',
  `PROVINCE_CODE` varchar(6) DEFAULT NULL COMMENT '开户行所在省份编码 他行卡且转账金额大于50000时必填',
  `PROVINCE_NAME` varchar(36) DEFAULT NULL COMMENT '开户行所在省份名称 他行卡且转账金额大于50000时必填',
  `CITY_CODE` varchar(6) DEFAULT NULL COMMENT '开户行所在城市编码 他行卡且转账金额大于50000时必填',
  `CITY_NAME` varchar(36) DEFAULT NULL COMMENT '开户行所在城市名称 他行卡且转账金额大于50000时必填',
  `PAYEE_BANK_ID` varchar(15) DEFAULT NULL COMMENT '收款网点行号 他行卡且转账金额大于50000时必填',
  `PAYEE_BANK_NAME` varchar(50) DEFAULT NULL COMMENT '收款网点名称 他行卡且转账金额大于50000时必填',
  `RETURN_CODE` varchar(32) DEFAULT NULL COMMENT '处理结果 SUCCESS/FAIL',
  `RETURN_MSG` varchar(64) DEFAULT NULL COMMENT '结果信息描述 处理成功 错误原因提示等',
  `DATA_STATUS` char(1) NOT NULL COMMENT '数据有效性 0-无效 1-有效',
  `CREATE_TIME` varchar(24) DEFAULT NULL COMMENT '创建时间 yyyy-mm-dd hh24:mi:ss',
  `REMARK` text COMMENT '备注信息',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户提现记录表';

